import React from "react";
import classes from "./Table.module.css";

const table = props => {
  console.log(props.moves);
  console.log("size of the object", props.moves);
  console.log("the data is data", props.moves);

  let moves = [];
  let data = [];
  let headers = [];
  let basePower = [];
  let duration = [];
  for (let key in props.moves) {
    data.push(key);
    moves.push({ quick_moves: props.moves[key], id: Math.random() });
  }

  console.log("the quick moves are", data);
  basePower = moves.map(el => {
    return el.quick_moves.stats.map(stat => {
      console.log(stat.dps);
      return <td key={Math.random()}> {stat.base_power} </td>;
    });
  });
  //   console.log("dps is", dps);

  duration = moves.map(el => {
    return el.quick_moves.stats.map(stat => {
      console.log(stat);

      return <td key={Math.random()}>{stat.duration}</td>;
    });
  });

  //   console.log("moves inside table", moves);
  //   moves.map(el => {
