  //     for (let key in el.data.quick_moves) {
  //       finalData.push({ quick_moves: el.data.quick_moves[key] });
  //     }
  //     console.log("data inside the map is", finalData);
  //   });
  //   console.log(finalData.quick_moves);
  return (
    <div className={classes.Table}>
      <table>
        <tr>
          <th key={Math.random()} style={{ textAlign: "left" }}>
            Stats{" "}
          </th>
          {data.map((el, index) => {
            return <th key={el.id}>Move {index + 1} </th>;
          })}
        </tr>
        <tbody>
          <tr>
            <td key={Math.random()} style={{ textAlign: "left" }}>
              Base Power
            </td>
            {basePower}
          </tr>
          <tr>
            <td key={Math.random()} style={{ textAlign: "left" }}>
              Duration
            </td>
            {duration}
          </tr>
        </tbody>
      </table>
    </div>
  );
};

export default table;
